import './ExpenseItem.css';

function ExpenseItem(props) {
  return (
    <div className="expense-item">
      <div>{this.props.expenseDate.toISOString()}</div>
      <div class="expense-item__description">
        <h2>{this.props.expenseTitle}</h2>
      </div>
      <div className="expense-item__price">${this.props.expenseAmount}</div>
    </div>
  );
}

export default ExpenseItem;
